import React from "react";
import './App.css';  

const App = () => {
  return (
    <div className="container">
      <span className="LogoBox">
        <span className="logo">Logo</span>
      </span>
      <span className="navigationBtns">
        <span className="HomeBtn">Home</span>
        <span className="InvestmentBtn">Investment</span>
        <span className="AboutUsBtn">About Us</span>
        <span className="ContactUsBtn">Contact Us</span>
      </span>
      <span className="accountBox">
        <span className="AccountBtn">Account</span>
      </span>
    </div>
  );
}

export default App;
